import Die from "./Die";

export default function Main() {

  return (
    <main
      className="main"
      style={{
        width: '80vh',
        height: '80vh',
        marginTop: '50px',
        backgroundColor: '',
        borderRadius: '10px',
        backgroundColor:'#F5F5F5',
      }}
    >
        <div
            style={{
                display: "grid",
                gridTemplate: '50px 50px / 50px 50px 50px 50px 50px',
                gap: '10px'
            }}
        >
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
            <Die value="1" />
      
        </div>
    </main>
  );
};
